import React from "react";
import "antd/dist/antd.css";
import "./ui.css";
import { Layout } from "antd";
const { Footer } = Layout;

const FooterSection = () => {
  return (
    <Footer style={{ textAlign: "center" }}>
      CheaterChecker Â©2021 Created by Noel Gregory
    </Footer>
  );
};

export default FooterSection;
